window.bookSummaryJSON = "<p>A vacation in Greece sounds like the perfect way for Kate Winters to spend her first sabbatical away from the Underworld... until she gets caught up in an immortal feud going back millennia. </p> <p>Castor and Pollux have been on the run from Zeus' and Hades' wrath for centuries, hiding from the gods who hunt them. The last person they trust is Kate, the new Queen of the Underworld. Nevertheless, she is determined to help their cause. But when it comes to dealing with immortals, Kate still has a lot to learn....</p>"; 
